import './App.css';
import axios from 'axios';
import { useState } from 'react';
// import NewPost from './NewPost';
function App() {
  const [file, setFile] = useState();
  const test = async () => {
    const result = await axios.get('/');
    setFile(result.data)
  };
  test();

  return (
    <div className="App">
      <h1>Insta App</h1>
      {/* <NewPost></NewPost> */}
      {file}
    </div>
  );
}

export default App;

// this component will represent home page for display all posts
